  ['path', { d: 'm5 19 6-6', key: 'jh6hbb' }],
  ['rect', { width: '4', height: '4', x: '3', y: '3', rx: '1', key: '14gycr' }],
  [
    'rect',
    { width: '4', height: '4', x: '17', y: '17', rx: '1', key: 'sl8njk' },
  ],
]);

export default Scale3d;
